import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../Components/CSS/Dashboard.css'; // Ensure you have CSS file for styles

function CustomerDashboard() {

    const navigate = useNavigate();
    const handleLogout = () => {
        // Perform any necessary logout operations, e.g., clearing tokens
        localStorage.removeItem('token'); // Example: removing link token from local storage
    
        // Redirect to login page
        navigate('/login');
      };

  return (
    // <div className="dashboard-container">
    //   <div className="sidebar">
    //     <h2>BookBliss</h2>
    //     <ul>
    //       <li><Link to="/home">Home</Link></li>
    //       <li><Link to="/books">Books</Link></li>
    //       <li><Link to="/cart">Cart</Link></li>
    //     </ul>
    //     <button onClick={handleLogout} className="btn btn-danger logout-btn">
    //       Logout
    //     </button>
    //   </div>
    //   <div className="content">
    //     {/* Content of the dashboard */}
    //     <h1>Welcome to your BookBliss!</h1>
    //     {/* Add more content here as needed */}
    //   </div>
    // </div>
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
      <div className="container-fluid">
        <a className="navbar-brand" href="#">Navbar</a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <a className="nav-link active" aria-current="page" href="#">Home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Link</a>
            </li>
            <li className="nav-item dropdown">
              <a
                className="nav-link dropdown-toggle"
                href="#"
                role="button"
                data-bs-toggle="dropdown"
                aria-expanded="false"
              >
                Dropdown
              </a>
              <ul className="dropdown-menu">
                <li><a className="dropdown-item" href="#">Action</a></li>
                <li><a className="dropdown-item" href="#">Another action</a></li>
                {/* <li><hr className="dropdown-divider" /></li> */}
                <li><a className="dropdown-item" href="#">Something else here</a></li>
              </ul>
            </li>
            <li className="nav-item">
              <a className="nav-link disabled" aria-disabled="true">Disabled</a>
            </li>
          </ul>
          <form className="d-flex" role="search">
            <button className="btn btn-outline-success" type="submit">Search</button>
          </form>
        </div>
      </div>
    </nav>
  );
}

export default CustomerDashboard;
